Text:
@uran235

Nice attitude dude. Actually, some do care about our rare language, we do (that includes the uploader, what have you uploaded lately, or ever?). But ok, it would be a good idea to comment in english, I give you that, but at least the description is in english... And because you seem to be such a nice fellow I just want to add att det var ett himla gnällande från många icke svensktalande, inte kan ni väl alla vara fjorton år eller? För med det språkbruket kan ni inte ha haft många års erfarenheter med den riktiga världen. 
Well now uran235, I am almost certain that your mature and non offensive language promptly will inspire us to always write in english, dont you think?

@uran235

But as the www originates from CERN i guess we should use German, French, Italian or Romansh whenever we post something on the web, English is not an official language in Switzerland. Or maybe Chinese as that is the largest language, why English?

But what do I know, you are the American and you are always right, or so you have been indoctrinated to believe...
